import React from "react";

const trending = () => {
  return (
    <section className="trending">
      <div className="wrapper">
        <h3>Trending</h3>
        <h5>Top view in this week</h5>
        <div className="product_container"></div>
      </div>
    </section>
  );
};

export default trending;
